import React, {useState} from 'react'
import Todo from './Todo'
import './TodoList.css'

const TodoList = ({ todos }) => {
    const [active, setActive] = useState(false);
    return (
        <div className="grid" onClick={setActive(false)}>
            {todos.map((element) => {
                return (
                    <Todo key={element.id} task={element} active={active} setActive={setActive} />
                )
            })}
        </div>
    )
}

export default TodoList
